    "Input Slot Options": "Opciones de parámetro de entrada",
    'Enter one option per line.\nOptionally use "=" as key/value delimiter and {} for submenus. e.g.\n   the answer=42': "Escribe cada opción en una línea.\nUsa (=) para asignar un valor y {} para submenús, por ejemplo:\n  respuesta=42",
