    'Traditional loop constructs (while, until, etc.) plus the Lisp "named let" (a generalization of FOR) plus functional iteration (repeated invocation of a function) and function composition.': 'Begizta egitura tradizionalak (while, until...) + Lisp-eko "named let" (for-aren orokortze bat) + iterazio funtzionala (funtzio bat modu errepikatuan deitzea) eta funtzioen konposizioa.',
    "List utilities": "Zerrenden utilitateak",
