    "Streams (lazy lists)": "Jarioak (zerrenda alferrak)",
    "A variation on the list data type in which each list item aren't computed until it's needed, so you can construct million-item lists without really taking up all that time or memory, or even infinite-sized lists.  (A block that reports all the prime numbers is included as an example.)": "Zerrenda datu motaren aldaera bat, non zerrendako elementu bakoitza ez den kalkulatzen behar den arte. Horri esker, milioi bat elementuko, edo tamaina infinitoko, zerrendak sor ditzakezu, beharrezkoa dena baino denbora edo memoria gehiago erabili gabe. (Zenbaki lehen guztiak itzultzen dituen bloke bat gehitu da adibide bezala).",
    "Variadic reporters": "Argumentu kopuru aldakorreko berriemaileak",
    "Versions of +, x, AND, and OR that take more than two inputs.": "Bi sarrera baino gehiago hartzen dituzten +, x, AND, eta OR-en aldaerak.",
    "Web services access (https)": "Web zerbitzuak atzitzea (https)",
    "An extended version of the HTTP:// block that allows POST, PUT, and DELETE as well as GET requests, allows using the secure HTTPS protocol, and gives control over headers, etc.": "GET, POST, PUT eta DELETE eskaerak egiteko aukera ematen duen HTTP:// blokearen hedapena. HTTPS protokolo segurua erabiltzeko aukera eta goiburuen gaineko kontrola ere ematen du...",
    "Words, sentences": "Hitzak, esaldiak",
    "One of the big ideas in Logo that they left out of Scratch is thinking of text as structured into words and sentences, rather than just a string of characters.  This library (along with the JOIN WORDS block in the Tools library) brings back that idea.": "Testuak karaktere-kate soil gisa hartu ordez hitz eta esaldietan egituratutzea da, Scratch-en ez dagoen, Logo-ren ideia handietako bat. Liburutegi honek, Tresnak liburutegiko JOIN WORDS blokearekin batera, ideia hori berreskuratzen du.",
    "Multi-branched conditional (switch)": "Adar anitzeko baldintzak (switch)",
    'Like "switch" in C-like languages or "cond" in Lisp.  Thanks to Nathan Dinsmore for inventing the idea of a separate block for each branch!': 'C bezalako lengoaietako "switch" edo Lisp-eko "cond"-en modukoa. Mila esker Nathan Dinsmore adar bakoitzerako bloke bereizia erabiltzeko ideia izateagatik!',
    "LEAP Motion controller": "LEAP mugimendu kontrolatzailea",
    "Report hand positions from LEAP Motion controller (leapmotion.com).": "Eskuen kokapena lortu LEAP mugimendu kontrolatzailea erabiliz (leapmotion.com).",
    "Set RGB or HSV pen color": "Ezarri RGB edo HSV arkatz koloreak",
    "Set or report pen color as RGB (red, green, blue) or HSV (hue, saturation, value).": "Arkatzaren kolorea ezarri edo itzultzen du RGB (gorria, berdea, urdina) edo HSV (ñabardura, saturazioa, balioa) bezala",
    "Catch errors in a script": "Atzeman programa bateko erroreak",
    "Run a script; if an error happens, instead of stopping the script with a red halo, run another script to handle the error. Also includes a block to cause an error with a message given as input. Also includes a block to create a script variable and give it a value.": "Exekutatu programa bat; Errore bat gertatzen bada, programa gelditu eta gorriz nabarmendu ordez, beste programa bat exekuta dezakezu errorea maneiatzeko. Sarrera bezala mezu bat jasotzen duen errore-bloke bat ere badakar eta programa aldagai bat sortu eta balioa emateko beste bloke bat ere bai.",
    "Allow multi-line text input to a block": "Lerro anitzeko testu sarrera blokeetan",
    "In general, text inputs allow only a single line.  The MULTILINE block accepts multi-line text input and can be used in text input slots of other blocks.": "Orokorrean, testu sarrerek lerro bakarra izaten dute. Bloke honek hainbat lerrotako testu sarrerak edukitzeko aukera ematen dizu. Testu sarrera erretenetan edo bestelako blokeetan erabil daiteke.",
    "Provide getters and setters for all GUI-controlled global settings": "GUI bidez kontrolatutako aukera global guztientzako getter eta setter-ak",
    "Eisenberg's Law: Anything that can be done from the GUI should be doable from the programming language, and vice versa.": "Eisenberg-en legea: Erabiltzaile interfaze grafiko bidez egin daitekeen edozein gauza programazio lengoaia erabiliz ere egin daiteke, eta alderantziz.",
    "Infinite precision integers, exact rationals, complex": "Zehaztasun infinituko zenbaki osoak, arrazional zehatzak, konplexuak",
    'The full Scheme numeric tower.  "USE BIGNUMS <True>" to enable.': 'Scheme-ren dorre numeriko osoa. "USE BIGNUMS <True>" aktibatzeko.',
