    'Traditional loop constructs (while, until, etc.) plus the Lisp "named let" (a generalization of FOR) plus functional iteration (repeated invocation of a function) and function composition.': "Comandos tradicionais para ciclos (enquanto, até que, etc.), o «named let» do Lisp (uma generalização do ciclo PARA), iteração funcional (invocação repetida de uma função) e composição de funções.",
    "Some standard functions on lists (append, reverse, etc.)": "Algumas funções padrão sobre listas (acrescentar, inverter, etc.)",
    "Streams (lazy lists)": "Canais (listas preguiçosas)",
    "A variation on the list data type in which each list item aren't computed until it's needed, so you can construct million-item lists without really taking up all that time or memory, or even infinite-sized lists.  (A block that reports all the prime numbers is included as an example.)": "Uma variação do tipo de dados lista para o qual cada item da lista não é calculado senão quando é necessário, pelo que pode criar listas com milhões de itens sem que isso demore demasiado tempo ou ocupe demasiada memória, ou mesmo listas de comprimento infinito.  (É incluído como exemplo um bloco que reporta todos os números primos.)",
    "Versions of +, x, AND, and OR that take more than two inputs.": "Versões de +, x, E, e OU que aceitam mais do que duas entradas.",
    "An extended version of the HTTP:// block that allows POST, PUT, and DELETE as well as GET requests, allows using the secure HTTPS protocol, and gives control over headers, etc.": "Uma versão estendida do bloco HTTP:// que permite realizar pedidos POST, PUT e DELETE, bem como GET, permite utilizar o protocolo seguro HTTPS e dá controlo sobre os cabeçalhos, etc.",
    "One of the big ideas in Logo that they left out of Scratch is thinking of text as structured into words and sentences, rather than just a string of characters.  This library brings back that idea.": "Um das grandes ideias do Logo que ficou de fora no Scratch é pensar no texto como estruturado em palavras e frases, em vez de só como uma cadeia de caracteres. Esta biblioteca reintroduz esta ideia.",
    'Like "switch" in C-like languages or "cond" in Lisp.  Thanks to Nathan Dinsmore for inventing the idea of a separate block for each branch!': "Tal como o «switch» em linguagens como o C ou o «cond» no Lisp.  Obrigado ao Nathan Dinsmore por inventar a ideia de ter um bloco separado para cada ramo!",
    "Report hand positions from LEAP Motion controller (leapmotion.com).": "Reportar posições das mãos dadas pelo controlador LEAP Motion (leapmotion.com).",
    "Text Costumes": "Trajes de texto",
